.gomodifytags {
  font-size: 12px;
}
.gomodifytags label {
  font-size: 15px;
  padding-right: 10px;
}
.gomodifytags .go-tags-flex-container {
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  justify-content: flex-start;
  align-content: stretch;
  align-items: center;
  vertical-align: middle;
}
.gomodifytags .go-tags-flex-container button {
  order: 0;
  flex: 0 1 auto;
  align-self: auto;
  margin-bottom: 10px;
}
.gomodifytags .go-tags-flex-container div {
  margin-left: 2px;
  margin-right: 2px;
  order: 0;
  flex: 2 1 auto;
  align-self: auto;
}
.gomodifytags .go-tags-list {
  font-size: 16px;
}
.gomodifytags .go-tags-list h3 {
  font-size: 115%;
}
.gomodifytags .btn {
  margin-right: 5px;
  margin-left: 5px;
}
.gomodifytags .case-radio-buttons .input-label {
  padding-right: 10px;
  padding-bottom: 10px;
}
.gomodifytags atom-text-editor[mini].invalid-input-value {
  border-color: #EF5350;
  box-shadow: 0 0 0 1px #EF5350;
  background-color: #fdeeee;
}
.gomodifytags atom-text-editor[mini].invalid-input-value .selection .region {
  background-color: #f7a9a8;
}
.gomodifytags atom-text-editor[mini].invalid-input-value .cursor {
  border-color: #EF5350;
}
